import React, { Component } from 'react';
import { useRouter } from 'next/router';
import IndexPage from '../components/index-page';
import Main from './main';

export default class extends Component {
  router = useRouter();

  render() {
    return (
      <>
        <IndexPage />
        <Main />
      </>
    );
  }
}
